import { Counter_Decrement, Counter_Increment, Counter_Reset } from "./counterRedux"

export const action_Increment=(value)=>({ type:Counter_Increment })
export const action_Decrement=(value)=>({ type: Counter_Decrement })
export const action_Reset=()=>({ type: Counter_Reset, payload: { value: 0 } })
